import React, { Component } from "react";
import WriteFrom from "../component/WriteForm";

class Write extends Component {
  handleCreate = (data) => {
    console.log(data);
  };

  render() {
    return (
      <div>
        <WriteFrom onCreate={this.handleCreate} />
      </div>
    );
  }
}

export default Write;
